import React, { useState } from 'react';
import { Grid } from '@material-ui/core';
import { Card, CardMedia } from '@material-ui/core';
import { Button, CardActions, CardContent, Typography } from '@material-ui/core';
// import { Accordion, AccordionSummary, AccordionDetails } from '@material-ui/core';
// import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

import CompareCars from './CompareCars';

const Cardetail = (car) => {

    const [cardetail, setCardetails] = useState(car.location.state.car);
    console.log(cardetail);


    return (
        <>
            <Grid container justify="space-between" spacing={2} style={{ padding: '30px', width: "100%", margin, backgroundColor: "white" }} >
                <Grid item xs={12} md={8} >
                    <Card container style={{ color: 'red', backgroundColor: '#f1f1f1' }} >
                        <CardMedia
                            component="img"
                            height="490"
                            width="100px"
                            image={cardetail.carImages}
                            alt="Car img"
                        />
                    </Card>
                </Grid>
                <Grid item xs={12} md={4}  >
                    <Card style={{ backgroundColor: '#757ce8' }} >
                        <CardContent >
                            <div className="container">heading<div align="right">data</div></div>

                            <Typography gutterBottom variant="h4"  >
                                Description
                            </Typography>
                            <Typography gutterBottom variant="h6" >
                                Brand Name: {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Model Name:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Registration Year:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Transmission Type:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Fuel Type:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Registration State:  {cardetail.brand}
                            </Typography>
                            <Typography gutterBottom variant="h6" >
                                Price:  {cardetail.brand}
                            </Typography>







                            <Typography variant="body2" color="text.secondary">
                                Small description about the car
                            </Typography>
                        </CardContent>
                        <CardActions>
                            <Button size="small">Read More</Button>
                        </CardActions>
                    </Card>

                </Grid>
            </Grid>
            <CompareCars />


            {/* <Grid container> */}
            {/* <Grid item xs={12} md={11}>
                <Accordion style={{ margin: '30px', width: "100%", backgroundColor: "blue" }} >
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel1a-content"
                        id="panel1a-header"
                    >
                        <Typography>Compare</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
                            malesuada lacus ex, sit amet blandit leo lobortis eget.
                        </Typography>
                    </AccordionDetails>
                </Accordion>

            </Grid> */}
        </>
    )
}

export default Cardetail;
